using Microsoft.EntityFrameworkCore;

namespace SeminarskiRSII.WebApi.Database.DataSeed
{
    public static class SobaSeed
    {
        public static void SeedSoba(this ModelBuilder modelBuilder)
        {
            List<Soba> list = new List<Soba>();
            string stringFromSQL1 = "";
            List<byte> byteList1 = new List<byte>();
            string hexPart1 = stringFromSQL1.Substring(2);
            for (int i = 0; i < hexPart1.Length / 2; i++)
            {
                string hexNumber = hexPart1.Substring(i * 2, 2);
                byteList1.Add((byte)Convert.ToInt32(hexNumber, 16));
            }
            byte[] originalSoba1 = byteList1.ToArray();

            string stringFromSQL2 = "";
            List<byte> byteList2 = new List<byte>();
            string hexPart2 = stringFromSQL2.Substring(2);
            for (int i = 0; i < hexPart2.Length / 2; i++)
            {
                string hexNumber = hexPart2.Substring(i * 2, 2);
                byteList2.Add((byte)Convert.ToInt32(hexNumber, 16));
            }
            byte[] originalSoba2 = byteList2.ToArray();

            list.AddRange(new List<Soba>()
            {
                new Soba()
                {
                    Id = 1,
                    BrojSobe = 1,
                    BrojSprata = 1,
                    OpisSobe = "Soba u tisini",
                    StatusSobe = "Slobodna",
                    Slika = originalSoba1
                },
                new Soba()
                {
                    Id = 2,
                    BrojSobe = 2,
                    BrojSprata = 1,
                    OpisSobe = "Soba u tisini",
                    StatusSobe = "Slobodna",
                    Slika = originalSoba2
                },
                new Soba()
                {
                    Id = 3,
                    BrojSobe = 3,
                    BrojSprata = 1,
                    OpisSobe = "Soba s pogledom na more",
                    StatusSobe = "Zauzeta",
                    Slika = originalSoba1
