                new Soba()
                {
                    Id = 4,
                    BrojSobe = 4,
                    BrojSprata = 2,
                    OpisSobe = "Soba s pogledom na cijeli grad",
                    StatusSobe = "Slobodna",
                    Slika = originalSoba2
                }
            });
            modelBuilder.Entity<Soba>().HasData(list);
        }
    }
}
